import {useState} from "react";

const {Link} = require("react-router-dom");
const Login = require("../loginPage/Login");
const React = require("react");
const Sidebar = (props) => {
    const [page, setPage] = useState();
    const [isOpen, setIsOpen] = useState(false);

    const profileModalOpen=() =>{
        setIsOpen(true);
    }

    const profileModalClose=() =>{
        setIsOpen(false);
    }

    const sendStatus=() => {
        props.getStatus(isOpen);
    }

    return (
        <div className="sidebar">
            <nav>
                <div className="userImg">
                    <button className="profileButton" onClick={profileModalOpen}>
                        <img src={require('../defaultImg/DefaultUserImg.png')} alt="대체 텍스트"/>
                    </button>
                </div>

                <div className="categoryImg">
                    <ul>
                        <li>
                            <Link to="/" element={<Login/>}>
                                <img src={require("../defaultImg/DefaultCategoryImg.png")}/>
                            </Link>
                        </li>
                        <li>
                            <Link to="/" element={<Login/>}>
                                <img src={require("../defaultImg/DefaultCategoryImg.png")}/>
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        </div>
    );
}

export default Sidebar;
